import React from 'react';
import './Footer.css'; // Импортируем CSS

const Footer = () => {
    return (
        <footer className="footer">
            <p className="footer-text">© 2024 Ваш Интернет Магазин. Все права защищены.</p>
        </footer>
    );
};

export default Footer;
